import React, { useState } from 'react';
import { Transition } from '@headlessui/react';

function Slider() {
  const [seccionAnimacion, setSeccionAnimacion] = useState('Inicio');

  const navegacion = (seccion) => {
    setSeccionAnimacion(seccion);
    const elemento = document.getElementById(seccion);
    if (elemento) {
      elemento.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="relative overflow-hidden">

      <nav className="fixed top-0 left-0 right-0 flex justify-center items-center py-4 z-50">
        <div className="ml-96 mr-96 flex justify-center items-center rounded-full shadow-md bg-white">
          <button
            onClick={() => navegacion('Inicio')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ${
              seccionAnimacion === 'Inicio' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Inicio
          </button>
          <button
            onClick={() => navegacion('Tecnologias')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ml-4 ${
              seccionAnimacion === 'Tecnologias' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Tecnologías
          </button>
          <button
            onClick={() => navegacion('ExperienciayFormacion')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ml-4 ${
              seccionAnimacion === 'ExperienciayFormacion' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Experiencia y Formación
          </button>
          <button
            onClick={() => navegacion('Proyectos')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ml-4 ${
              seccionAnimacion === 'Proyectos' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Proyectos
          </button>
        </div>
      </nav>

      {/* Inicio */}
      <Transition
        show={seccionAnimacion === 'Inicio'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform -translate-x-full"
        enterTo="opacity-100 transform translate-x-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-x-0"
        leaveTo="opacity-0 transform translate-x-full"
      >
        {(ref) => (
          <div ref={ref} id="Inicio" className="h-screen flex flex-col items-center justify-center">
            <div className="absolute inset-0 bg-gradient-to-r from-red-500 to-yellow-500 transform translate-x-0 animate-slide">
              {/* Aquí puedes agregar elementos para el fondo */}
            </div>
            <h2 className="text-4xl font-bold">Inicio</h2>
            <p className="mt-2">Scroll Down for next slide</p>
          </div>
        )}
      </Transition>

      {/* Tecnologías */}
      <Transition
        show={seccionAnimacion === 'Tecnologias'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform translate-x-full"
        enterTo="opacity-100 transform translate-x-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-x-0"
        leaveTo="opacity-0 transform translate-x-full"
      >
        {(ref) => (
          <div ref={ref} id="Tecnologias" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-indigo-800 to-purple-800 text-white">
            <div className="absolute inset-0 bg-gradient-to-r from-red-500 to-yellow-500 transform translate-x-0 animate-slide">
              {/* Aquí puedes agregar elementos para el fondo */}
            </div>
            <h2 className="text-4xl font-bold">Tecnologías</h2>
            <p className="mt-2">Scroll Down for next slide</p>
          </div>
        )}
      </Transition>

      {/* Experiencia y Formación */}
      <Transition
        show={seccionAnimacion === 'ExperienciayFormacion'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform -translate-y-full"
        enterTo="opacity-100 transform translate-y-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-y-0"
        leaveTo="opacity-0 transform -translate-y-full"
      >
        {(ref) => (
          <div ref={ref} id="ExperienciayFormacion" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-purple-800 to-pink-800 text-white">
            <div className="absolute inset-0 bg-gradient-to-r from-red-500 to-yellow-500 transform translate-x-0 animate-slide">
              {/* Aquí puedes agregar elementos para el fondo */}
            </div>
            <h2 className="text-4xl font-bold">Experiencia y Formación</h2>
            <p className="mt-2">Scroll Down</p>
          </div>
        )}
      </Transition>

      {/* Proyectos */}
      <Transition
        show={seccionAnimacion === 'Proyectos'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform translate-y-full"
        enterTo="opacity-100 transform translate-y-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-y-0"
        leaveTo="opacity-0 transform translate-y-full"
      >
        {(ref) => (
          <div ref={ref} id="Proyectos" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-blue-200 to-indigo-100 text-black">
            <div className="absolute inset-0 bg-gradient-to-r from-red-500 to-yellow-500 transform translate-x-0 animate-slide">
              {/* Aquí puedes agregar elementos para el fondo */}
            </div>
            <h2 className="text-4xl font-bold">Proyectos</h2>
          </div>
        )}
      </Transition>

      {/* Estilo para la animación del fondo */}
      <style jsx>{`
        .animate-slide {
          animation: slide 2s linear infinite alternate;
        }
        
        @keyframes slide {
          from {
            transform: translateX(-100%);
          }
          to {
            transform: translateX(100%);
          }
        }
      `}</style>

    </div>
  );
}

export default Slider;
